import React from "react"
import Greeting from "./Greeting"
import PropTypes from "prop-types"
class App extends React.Component {
  render () {
    return (

          <BrowserRouter>
            <Switch>
              <Route exact path="/" render={() => ("Home!")} />
              <Route path="/Greeting" render={() => <Greeting  greeting="Friend" />} />
            </Switch>
          </BrowserRouter>

    );
  }
}

export default App
